import React from 'react'

function LeftItems(props) {
    return (
        <div style={{display:'flex',flexDirection:'row',alignItems:'center'}}>
            {props.icon}
            <div style={{width:'10px'}}></div>
            <h4>{props.title}</h4>
        </div>
    )
}

export default LeftItems
